import React from "react";
import logo from "./Assets/logo2.png"
function App() {
  return (
    <div className="w-screen h-screen bg-white text-white">
    <img className="ml-2 mt-2 w-[400px] h-[70px]" alt="" src={logo}></img>
    </div>
  );
}

export default App;
